function ExpenseDate() {
    const month = props.date.toLocaleString('en-UK', { month: 'short' });
    const day = props.date.toLocaleString('en-UK', { day: '2-digit' });
    const year = props.date.getFullYear();

    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}

export default ExpenseDate;
